script: |
  super -f text -I q7111.spq | sort > q7111.out

inputs:
  - name: q7111.spq
    data: |
      SELECT col1 / - col2 FROM tab0 (FORMAT parquet) WHERE - - col2 + + 68 - col1 * - col2 / - col2 NOT BETWEEN + col2 AND + 55;
  - name: tab0

outputs:
  - name: q7111.out
    data: |
      -1
      -2
      0
